  false,\n\t\"url\": null,\n\t\"notes\": \"In 2001, 25 vessels > 50 feet in overall
  length joined the American Samoa longline fleet, which previously had consisted
  of local, small catamaran-style vessels (called alias) targeting albacore (Thunnus
  alalunga).  The entrance of these modern longliners drew considerable attention
  due to social, economic, and fishery sustainability concerns.  Economic information
  on 18 vessels were gathered by personal interviews with vessel operators, owners,
  or managers. Revenue information was estimated based on NMFS logbook data (landing
  and effort) and fish price data mainly provided by the 2001 Forum Fishing Agency.
  Operational and vessel costs were collected through in-person  interviews with vessel
  owners, captains, and crew.  This was the first cost-earnings study on this fleet.
  \ J. M. O'Malley and S.G. Pooley conducted this project.\",\n\t\"license_title\":
